import React from 'react';
import TenantLeaseCard from '../components/TenantLeaseCard';

const TenantDashboard = ({ user }) => {
  return (
    <div style={containerStyle}>
      <h2 style={headingStyle}>Welcome, {user.name}!</h2>
      <p style={subtextStyle}>Role: tenant</p>

      <div style={sectionStyle}>
        <h3 style={sectionTitle}>Tenant Profile</h3>
        <p><strong>Name:</strong> {user.name}</p>
        <p><strong>Email:</strong> {user.email}</p>
      </div>

      <div style={sectionStyle}>
        <h3 style={sectionTitle}>Lease Info</h3>
        <TenantLeaseCard userId={user.id} />
      </div>

      <div style={sectionStyle}>
        <h3 style={sectionTitle}>Payment History</h3>
        <p>No payments found.</p>
        <button style={buttonStyle}>Make a Payment</button>
      </div>
    </div>
  );
};

const containerStyle = {
  padding: '2rem',
  fontFamily: 'Segoe UI, sans-serif',
  backgroundColor: '#f9f9f9',
  minHeight: '100vh'
};

const headingStyle = {
  fontSize: '1.8rem',
  marginBottom: '0.5rem',
  color: '#333'
};

const subtextStyle = {
  fontSize: '1rem',
  marginBottom: '2rem',
  color: '#666'
};

const sectionStyle = {
  marginBottom: '2rem',
  backgroundColor: '#fff',
  padding: '1rem',
  borderRadius: '8px',
  boxShadow: '0 2px 6px rgba(0,0,0,0.1)'
};

const sectionTitle = {
  fontSize: '1.2rem',
  marginBottom: '1rem',
  color: '#333',
  borderBottom: '1px solid #ccc',
  paddingBottom: '0.5rem'
};

const buttonStyle = {
  padding: '0.5rem 1rem',
  backgroundColor: '#0078D4',
  color: '#fff',
  border: 'none',
  borderRadius: '4px',
  cursor: 'pointer'
};

export default TenantDashboard;
